import React from 'react';
import './styles.css';
import { Link } from 'react-scroll';

export default function Home() {

    const indexImage = require('../../Assets/Images/index-image.jpg');
    const logo = require('../../Assets/Images/logo-in8-dev.svg');

    return (
        <div className="home-container">
            <div className="content">
                <img className="image-index" src={indexImage} alt=""/>
                <img className="logo-index" src={logo} alt=""/>
                <div className="home-title">
                    <div style={{fontSize: 72}}>ESTÁGIO</div> 
                    <div style={{fontSize: 32}}>PROVA DE SELEÇÃO</div>
                </div>
                <div>
                    <Link className="quick-link"
                        activeClass="active"
                        to="register"
                        spy={true}
                        smooth={true}
                        offset={0}
                        duration={500}
                    >
                    cadastro</Link>
                    <Link
                        activeClass="active"
                        to="users"
                        spy={true}
                        smooth={true}
                        offset={0}
                        duration={500}
                    >
                    lista</Link>
                    <Link
                        activeClass="active"
                        to="about"
                        spy={true}
                        smooth={true}
                        offset={0}
                        duration={500}
                    >
                    sobre mim</Link>
                </div>
            </div>
        </div>
    );
}
